Our application helps you buy a virtual number and use it as a regular number, but without a SIM card.

FOR WHOME IT CAN BE USEFUL:
∗ for travelers;
∗ for registering on websites or applications;
∗ you can use it as a second phone for work, family or friends.

BENEFITS
∗ It is the same number as a regular number, just without a SIM card;
∗ You can buy a new number at any time or delete your old number if you don't need it;
∗ There are different tariff plans, which will allow you to choose the most advantageous plan, depending on your needs;
∗ Cheap calls and texts to the US and Canada;
∗ You don't need a phone that supports multiple SIM cards.

FEATURES
∗ Buying virtual numbers in the U.S.;
∗ Sending text and multimedia messages;
∗ Full message and call history;
∗ Switching between several numbers;∗ Deleting history;
∗ Flexible rates and tarrifs.
You need a subscription or credit packs to buy a number, make calls or send messages.

PREMIUM ACCESS
You can subscribe to all features for unlimited access. With premium access you get to use all the features of the application (get number, make call and texting):
∗ Weekly subscription with a 3-day trial costs $7.99;
∗ Monthly subscription costs $19.99;
∗ 3 months subscription costs $39.99;
∗ 6 months subscription costs $49.99.
The exact price depends on the region of your account.

CREDITS PACK
You can always top up your balance to make more calls, messages or buy a new number.
∗ 100 coins for $3.99;
∗ 250 coins for $6.99;
∗ 500 coins for $9.99;
∗ 1,000 coins for $19.99;
∗ 2,000 coins for $29.99;
∗ 3000 coins for $39,99.
The exact price depends on the region of your account.

Subscription information:
∗ Subscription automatically renews unless auto-renew is turned off at least 24-hours before the end of the current period;
∗ Subscriptions may be managed by the user and auto-renewal may be turned off by going to the user's Account Settings after purchase;
∗ Any unused portion of a free trial period will be forfeited when the user purchases a subscription;
∗ Payment will be charged to iTunes Account at confirmation of purchase.
∗ Account will be charged for renewal within 24 hours prior to the end of the current period. The cost depends on the selected plan.

